from typing import List
import itertools
import collections


class Solution:
    def findDiagonalOrder(self, nums: List[List[int]]) -> List[int]:
        rows = len(nums)
        cols = max(len(row) for row in nums)
        diagonals = [collections.deque() for _ in range(rows + cols)]
        for r, row in enumerate(nums):
            for c, val in enumerate(row):
                diagonals[r+c].appendleft(val)
        print(diagonals)
        return list(itertools.chain(*diagonals))


def test_1():
    nums = [[1,2,3],[4,5,6],[7,8,9]]
    expected = [1,4,2,7,5,3,8,6,9]
    assert Solution().findDiagonalOrder(nums) == expected


